script: |
  super -f text -I q2638.spq | sort > q2638.out

inputs:
  - name: q2638.spq
    data: |
      SELECT + ( - col0 ) - + col0 * - col0 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE 69 NOT BETWEEN + ( - + col0 ) * - col2 AND - col0;
  - name: tab2

outputs:
  - name: q2638.out
    data: |
      2070
      4032
      5550
